import React, { createContext } from 'react'
import all_product from '../Components/all_products.js'


export const FashionContext = createContext(null)

const FashionContextProvider = (props) => {
    const contextValue = {all_product};
    return (
        <FashionContext.Provider value = {contextValue} >
            {props.children}
        </FashionContext.Provider>
    )
}

export default FashionContextProvider
